import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/app';

import YandexFlightsShedule from './services/yandex-flights-shedule';
const inMoscow = 'https://cors-anywhere.herokuapp.com/https://api.rasp.yandex.net/v3.0/schedule/?apikey=4947ef3f-adeb-4221-93ec-743762d9d209&station=s9600213&transport_types=plane&event=arrival';

YandexFlightsShedule.test(inMoscow).then((body) => {
	console.log(body);
});

ReactDOM.render(<App />, 
	document.getElementById('root'));
